import React from "react";

import restro from "./Photo/logo.png"
import logo1 from "./Photo/bubble.jpg"
import logo2 from "./Photo/images.jpg"
import logo3 from "./Photo/Untitled.jpg"


import  ProjectSub  from "./Project_sub";
const Project = () =>{

    return (
        <div className="Projects" id="Projects">
            <h1 className="h1" style={{color: "aliceblue" }}>Project</h1>
            <div className="ProjectSub">
            <ProjectSub 
            logo = {restro} 
            name = {"Restro website "} 
            text = {"Classification is a type of machine learning algorithm that is used to categorize data into different classes or categories based on specific features or attributes. It is widely used in various applications such as image recognition, spam filtering, and sentiment analysis"}
             />
            <ProjectSub
            logo = {logo1} 
            name = {"Real Live Chat App"}
            text = {"A real-time chat application built with Node.js, Express, and Socket.IO can provide a seamless and interactive communication platform for users. Node.js and Express are widely used for building server-side applications, while Socket.IO is a popular library that enables real-time, bidirectional communication between the server and the client"}
            />
            <ProjectSub
            logo = {logo2} 
            name = {"Movie Recommendation System"}
            text = {"A movie recommendation system built with machine learning and Streamlit Python can provide an intelligent and personalized platform for suggesting movies to users based on their preferences and behavior. Machine learning algorithms can analyze user data such as movie ratings, watch history, and genre preferences, and make predictions about which movies a user is likely to enjoy"}
            />            
            <ProjectSub
            logo = {logo3} 
            name = {"Classification Algorithm Machine Learning"}
            text = {"Classification is a type of machine learning algorithm that is used to categorize data into different classes or categories based on specific features or attributes. It is widely used in various applications such as image recognition, spam filtering, and sentiment analysis"}
            />            
            {/* <ProjectSub
            logo = {restro} 
            name = {"Real Live Chat App"}
            />             */}
            </div>           
        </div>
    )
}


export default Project
